	add("pandar", "{\"term\":\"pandar\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Chaucer’s character w:Pandarus|Pandare (in \u0027w:Troilus and Criseyde|Troilus and Criseyde\u0027), from Italian w:Pandarus|Pandaro (found in w:Boccaccio|Boccaccio), from Latin w:Pandarus|Pandarus, from Ancient greek (to 1453) \u0027πάνδαρος\u0027 (See also Shakespeare’s \u0027wikibooks:Troilus and Cressida|Troilus and Cressida\u0027.)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who furthers the illicit love-affairs of others; a pimp or procurer, especially when male\", \"priority\":1}]}, \"synonyms\":{}}");

	add("pandeism", "{\"term\":\"pandeism\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"German\", \"English\", \"ancient greek (to 1453)\", \"Italian\", \"Latin\"], \"text\":\"A {{blend|pantheism|deism|nocap\u003d1|lang\u003den}}; or possibly from German \u0027pandeismus\u0027 or Italian \u0027pandeismo\u0027 from Ancient greek (to 1453) \u0027πάν\u0027 (all) and Latin \u0027deus\u0027 (god) First appearance in a dictionary was in 1849.\u0026lt;!-- First used in the variation \u0026quot;Pandeisten\u0026quot; (pandeists) by w:Moritz Lazarus|Moritz Lazarus and w:Heymann Steinthal|Heymann Steinthal in \u0027Zeitschrift für Völkerpsychologie und Sprachwissenschaft\u0027 (1859), p. 262.--\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A coherent belief in a God who is both pantheistic and deistic, e.g. a God who designed the universe and then created it by becoming\u0027 the universe, thus ceasing to act consciously with respect to the universe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1941\u0027\u0027, w:Charles Charles Hartshorne, \u0027Man\u0027s Vision of God and the Logic of Theism\u0027, p. 348\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Just as [absolute perfection in some respects, relative perfection in all others] is the whole positive content of perfection, so CW, or the conception of the Creator-and-the-Whole-of-what-he-has-created as constituting one life, the super-whole which in its everlasting essence is uncreated (and does not necessitate just the parts which the whole has) but in its de facto concreteness is created - this panentheistic doctrine contains all of deism and \u0027\u0027pandeism\u0027\u0027 except their arbitrary negations\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1967\u0027\u0027, w:F.E. Francis E. Peters, \u0027Greek Philosophical Terms: A Historical Lexicon\u0027, p. 169\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"What appeared here, at the center of the Pythagorean tradition in philosophy, is another view of \u0027psyche\u0027 that seems to owe little or nothing to the pan-vitalism or \u0027\u0027pan-deism\u0027\u0027 (see \u0027theion\u0027) that is the legacy of the Milesians\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Pastor Bob Burridge, \u0027[http://www.girs.com/library/theology/syllabus/theo4.html Theology Proper - Lesson 4: The Decrees of God\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The reality of secondary causes is what separates Christian theism from \u0027\u0027pandeism\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Donald L. Jackson, \u0027Religious Lies - Religious Truths: It\u0027s Time To Tell The Truth!\u0027, page 175\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Charles Hartshorne introduced his process theology in the 1940s, in which he examined, and discarded pantheism, deism and \u0027\u0027pandeism\u0027\u0027 in favor of panentheism, finding that such a doctrine contains all of deism and \u0027\u0027pandeism\u0027\u0027 except their arbitrary negative aspects\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Worship which admits or tolerates favorable aspects of all religions; omnitheism\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027, w:Yale Yale University w:Sheffield Scientific Sheffield Scientific School, \u0027Yale Sheffield Monthly\u0027, p. 463\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"We hear men prophecy that this war means the death of Christianity and an era of \u0027\u0027Pandeism\u0027\u0027 or perhaps even the destruction of all which we call modern civilization and culture. We hear men predict that the ultimate result of the war will be a blessing to humanity\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027, w:J. Sidlow J. Sidlow Baxter, \u0027[http://www.pwmi.org/index.php?option\u003dcom_content\u0026amp;view\u003darticle\u0026amp;id\u003d137:our-bible-the-most-critical-issue\u0026amp;catid\u003d23:general-articles\u0026amp;Itemid\u003d252 Our Bible: The Most Critical Issue\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"If the Bible is only human lore, and not divine truth, then we have no real answer to those who say, \u0027Let\u0027s pick the best out of all religions and blend it all into \u0027\u0027Pan-Deism\u0027\u0027 - one world religion with one god made out of many\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Conrad Baker, \u0027[http://www.maranathamedia.com.au/start/index.php?option\u003dcom_docman\u0026amp;task\u003ddoc_details\u0026amp;gid\u003d997 The Three Powers Of Armageddon ]: An Exposition of Revelation 16:13-16\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The Church of Rome uses the term \u0026quot;\u0027\u0027pandeism\u0027\u0027\u0026quot;, to describe her current program of bringing under her wing the non-Christian religions of the world\", \"priority\":16}]}, \"synonyms\":{}}");

	add("pander", "{\"term\":\"pander\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Italian\", \"Latin\"], \"text\":\"From Chaucer’s character \u0027w:pandarus\u0027 (in \u0027w:Troilus and Criseyde|Troilus and Criseyde\u0027), from Italian \u0027w:pandarus\u0027 (found in w:Boccaccio|Boccaccio), from Latin \u0027w:pandarus\u0027 from Ancient greek (to 1453) \u0027πάνδαρος\u0027 (See also Shakespeare’s wikibooks:Troilus and Cressida|Troilus and Cressida).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who furthers the illicit love-affairs of others; a pimp or procurer. (Later panderer\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Moncrieff/Kilmartin/Enright, translating Marcel Proust, \u0027Swann’s Way\u0027, Folio Society 2005, p. 190\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It was not only the brilliant phalanx of virtuous dowagers, generals and academicians with whom he was most intimately associated that Swann so cynically compelled to serve him as \u0027\u0027panders\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An offer of illicit sex with a third party\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An illicit or illegal offer, usually to tempt\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"One who ministers to the evil designs and passions of another\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Those wicked \u0027\u0027panders\u0027\u0027 to avarice and ambition\", \"priority\":7}]}, \"synonyms\":{}}");

